import Header from "./Header";

class Main extends React.Component {
    state = {
        memos: []
    }

    componentDidMount() {
        const memos = [{
            title: "First",
            date: new Date(2019, 0, 19),
            content: "This is the first memo"
        }, {
            title: 'Second',
            date: new Date(2020, 0, 1),
            content
        }]
    }

    render() {
        return (
            <div className="Main">
                <Header username={this.props.username} />
                <div className="memos">

                </div>
            </div>
        )
    }
}

export default Main
